BEGIN TRANSACTION;
CREATE TABLE `TheoryIndex` (
	`ID`		INTEGER NOT NULL UNIQUE,
	`PTO`		INTEGER NOT NULL,
	`FNS`		TEXT 	NOT NULL,
	`DAMP`		INTEGER NOT NULL,
	`IC`		INTEGER NOT NULL,
	`ModEv`		TEXT 	NOT NULL,
	`XIR`		REAL 	NOT NULL,
	`XIF`		REAL 	NOT NULL,
	`NfFF`		INTEGER NOT NULL,
	`MaxNfAs`	INTEGER NOT NULL,
	`MaxNfPdf`	INTEGER NOT NULL,
	`Q0`		REAL 	NOT NULL,
	`alphas`	REAL 	NOT NULL,
	`Qref`		REAL 	NOT NULL,
	`QED`		INTEGER NOT NULL,
	`alphaqed`	REAL 	NOT NULL,
	`Qedref`	REAL 	NOT NULL,
	`SxRes`		INTEGER NOT NULL,
	`SxOrd`		TEXT 	NOT NULL,
	`HQ`		TEXT 	NOT NULL,
	`mc`		REAL 	NOT NULL,
	`Qmc`		REAL 	NOT NULL,
	`kcThr`		REAL 	NOT NULL,
	`mb`		REAL 	NOT NULL,
	`Qmb`		REAL 	NOT NULL,
	`kbThr`		REAL 	NOT NULL,
	`mt`		REAL 	NOT NULL,
	`Qmt`		REAL 	NOT NULL,
	`ktThr`		REAL 	NOT NULL,
	`CKM`		TEXT 	NOT NULL,
	`MZ`		REAL 	NOT NULL,
	`MW`		REAL 	NOT NULL,
	`GF`		REAL 	NOT NULL,
	`SIN2TW`	REAL 	NOT NULL,
	`TMC`		INTEGER NOT NULL,
	`MP`		REAL 	NOT NULL,
	`Comments`	TEXT,
	/* Primary Key */
	PRIMARY KEY(ID),
	/* Checks */
	CHECK(PTO IN ( 0 , 1 , 2 )),
	CHECK(FNS IN ( 'FFNS' , 'ZM-VFNS' , 'FONLL-A' , 'FONLL-B' , 'FONLL-C' )),
	CHECK(DAMP IN ( 0 , 1 )),
	CHECK(IC IN ( 0 , 1 )),
	CHECK(ModEv IN ( 'EXA' , 'EXP' , 'TRN' )),
	CHECK(XIR > 0),
	CHECK(XIF > 0),
	CHECK(NfFF IN ( 3 , 4 , 5 , 6 )),
	CHECK(MaxNfAs IN ( 3 , 4 , 5 , 6 )),
	CHECK(MaxNfPdf IN ( 3 , 4 , 5 , 6 )),
	CHECK(Q0 > 0),
	CHECK(alphas > 0 AND alphas < 1),
	CHECK(Qref > 0),
	CHECK(QED IN ( 0 , 1 )),
	CHECK(alphaqed > 0 AND alphaqed < 1),
	CHECK(Qedref > 0),
	CHECK(SxRes IN ( 0 , 1 )),
	CHECK(SxOrd IN ( 'LL' , 'NLL' , 'NNLL' )),
	CHECK(HQ IN ( 'POLE' , 'MSBAR' )),
	CHECK(mc > 0),
	CHECK(Qmc >= 0),
	CHECK(kcThr >= 0),
	CHECK(mb > 0),
	CHECK(Qmb >= 0),
	CHECK(kbThr >= 0),
	CHECK(mt > 0),
	CHECK(Qmt >= 0),
	CHECK(ktThr >= 0),
	CHECK(MZ > 0),
	CHECK(MW > 0),
	CHECK(GF > 0),
	CHECK(SIN2TW > 0 AND SIN2TW < 1),
	CHECK(TMC IN ( 0 , 1 )),
	CHECK(MP > 0)
);



COMMIT;
